import React from 'react';
import logo from '../assets/logo.png'; // 로고 이미지를 import 합니다.

const Header = () => {
  return (
    <header className="header">
      <div className="top-bar">
        <div className="logo">
          <img src={logo} alt="Logo" style={{ height: '40px' }} /> {/* 로고 이미지를 삽입 */}
        </div>
        <input type="text" className="search-bar" placeholder="검색" />
        <div className="auth-buttons">
          <button>로그인</button>
          <button>회원가입</button>
        </div>
      </div>
      <nav>
        <ul>
          <li>MY 강의</li>
          <li>학습노트</li>
          <li>퀴즈</li>
          <li>로드맵</li>
          <li>커뮤니티</li>
          <li>마이페이지</li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
